import React from 'react';
import './NewPost.scss';
import {TextField, Button, Typograpghy, makeStyles, Icon} from '@material-ui/core';
import {CancelIcon} from '@material-ui/icons/Cancel';

const useStyles = makeStyles ({
  disabledButton: {
    color: '#000020'
  },
  enabledButton: {
    color: '#000000'
  }
})

const NewPost = () => {
  const classes = useStyles();

  return (
    <div className="NewPostModal">
      <div class="IconWrapper"></div>
    <CancelIcon>ok</CancelIcon>

      <img src="https://i.imgur.com/9wF1kZd.jpeg" class="UploadedImg"></img>

      <div class="FieldWrapper"><TextField
      label="Your Name"
      fullWidth>
      </TextField></div>

      <div class="FieldWrapper"><TextField
      label="Your Comment"
      multiline
      fullWidth>
      </TextField></div>

      <div class="ButtonWrapper"><Button
      color="primary">
        SHARE
      </Button></div>
    </div> 
  )
}

export default NewPost;
